let postBookAppointment = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      // ===================== CHECK REQUIRED BOOKING FIELDS =====================
      if (
        !data.email ||
        !data.doctorID ||
        !data.timeType ||
        !data.date ||
        !data.fullname ||
        !data.selectedGender ||
        !data.address
      ) {
        return resolve({
          errCode: 1,
          errMessage: "Missing required booking fields",
        });
      }

      // ===================== UPSERT USER =====================
      let [user] = await db.User.findOrCreate({
        where: { email: data.email },
        defaults: {
          email: data.email,
          roleId: "R3",
          gender: data.selectedGender,
          address: data.address,
          firstName: data.fullname,
          phoneNumber: data.phoneNumber,
        },
      });

      // ===================== CREATE PET IF PROVIDED =====================
      let petId = null;

      if (data.pet) {
        if (data.pet.id) {
          // dng pet  tn ti
          petId = data.pet.id;
        } else {
          // to pet mi
          let newPet = await db.Pet.create({
            name: data.pet.name,
            species: data.pet.species,
            breed: data.pet.breed,
            birthday: data.pet.birthday,
            weight: data.pet.weight,
            gender: data.pet.gender,
            status: data.pet.status || "active",
            ownerId: user.id,
          });

          petId = newPet.id;
        }
      }

      // ===================== CREATE BOOKING =====================
      let token = uuidv4();

      await db.Booking.create({
        statusID: "S1",
        doctorID: data.doctorID,
        patientID: user.id,
        petId: petId,
        date: data.date,
        timeType: data.timeType,
        token: token,
        reason: data.reason,
      });

      return resolve({
        errCode: 0,
        errMessage: "Booking & Pet saved!",
      });
    } catch (e) {
      reject(e);
    }
  });
};

let postVerifyBookAppointment = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (!data.token || !data.doctorID) {
        resolve({
          errCode: 1,
          errMessage: "Missing required Parameter!",
        });
      } else {
        let appointment = await db.Booking.findOne({
          where: {
            doctorID: data.doctorID,
            token: data.token,
            statusID: "S1",
          },
          raw: false,
        });
        if (appointment) {
          // await appointment.save({
          //   statusID: "S2",
          // });
          appointment.statusID = "S2";
          await appointment.save();
          resolve({
            errCode: 0,
            errMessage: "Update the Appointment succeed!",
          });
        } else {
          resolve({
            errCode: 2,
            errMessage: "You already have an existing appointment!",
          });
        }
      }
    } catch (e) {
      reject(e);
    }
  });
};

let getBookingHistory = (email) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (!email) {
        resolve({
          errCode: 1,
          errMessage: "Missing required Parameter!",
        });
      } else {
        let user = await db.User.findOne({ where: { email } });
        if (!user) {
          resolve({
            errCode: 2,
            errMessage: "User not found!",
          });
        } else {
          let bookings = await db.Booking.findAll({
            where: { patientID: user.id, statusID: "S2" },
            include: [
              {
                model: db.User,
                as: "patientData",
                attributes: ["firstName", "lastName", "phoneNumber", "email"],
              },
              {
                model: db.User,
                as: "doctorData",
                attributes: ["firstName", "lastName"],
              },
              {
                model: db.Allcode,
                as: "timeTypeDataPatient",
                attributes: ["valueVI", "valueEN"],
              },
            ],
            raw: false,
            nest: true,
          });
          resolve({
            errCode: 0,
            data: bookings,
          });
        }
      }
    } catch (e) {
      reject(e);
    }
  });
};

let getBookingStatusByEmail = (email) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (!email) {
        return resolve({
          errCode: 1,
          errMessage: "Missing email",
          data: [],
        });
      }

      // tm user c email
      let user = await db.User.findOne({
        where: { email: email },
        attributes: ["id"],
      });

      if (!user) {
        return resolve({
          errCode: 2,
          errMessage: "Email not exist",
          data: [],
        });
      }

      // ly lch ca user ny, nhng ch ly status = S2
      let data = await db.Booking.findAll({
        where: {
          patientId: user.id,
          statusId: { [Op.in]: ["S1", "S2", "S4"] },
        },
        attributes: [
          "id",
          "statusId",
          "date",
          "timeType",
          "animal",
          "doctorId",
        ],
        include: [
          {
            model: db.User,
            as: "doctorData",
            attributes: [
              "id",
              "firstName",
              "lastName",
              "gender",
              "phoneNumber",
              "image",
              "email",
            ],
            include: [
              {
                model: db.Allcode,
                as: "genderData",
                attributes: ["valueEN", "valueVI"],
              },
            ],
          },
          {
            model: db.User,
            as: "patientData",
            attributes: ["email", "firstName", "gender", "address"],

            include: [
              {
                model: db.Allcode,
                as: "genderData",
                attributes: ["valueEN", "valueVI"],
              },
            ],
          },
          {
            model: db.Allcode,
            as: "timeTypeDataPatient",
            attributes: ["valueEN", "valueVI"],
          },
          {
            model: db.Allcode,
            as: "statusData",
            attributes: ["valueEN", "valueVI"],
          },
        ],
        raw: true,
        nest: true,
      });

      return resolve({
        errCode: 0,
        errMessage: "OK",
        data,
      });
    } catch (e) {
      reject(e);
    }
  });
};

let cancelBooking = async (bookingId) => {
  try {
    if (!bookingId) {
      return {
        errCode: 1,
        errMessage: "Missing bookingId",
      };
    }

    let booking = await db.Booking.findOne({
      where: { id: bookingId },
    });

    if (!booking) {
      return {
        errCode: 2,
        errMessage: "Booking not found",
      };
    }

    // update sang S5 (n hon ton trn FE)
    await db.Booking.update({ statusID: "S5" }, { where: { id: bookingId } });

    return {
      errCode: 0,
      errMessage: "Cancel success",
    };
  } catch (e) {
    console.log("Service error:", e);
    return {
      errCode: -1,
      errMessage: "Server error",
    };
  }
};

let rescheduleBooking = async (data) => {
  try {
    if (!data.bookingId || !data.date || !data.timeType) {
      return {
        errCode: 1,
        errMessage: "Missing required params",
      };
    }

    await db.Booking.update(
      {
        date: data.date,
        timeType: data.timeType,
        statusID: "S1", // a v trng thi ch xc nhn li
      },
      { where: { id: data.bookingId } }
    );

    return { errCode: 0, errMessage: "Reschedule success" };
  } catch (e) {
    console.log("Service error:", e);
    return { errCode: -1, errMessage: "Server error" };
  }
};

let getBookingStatusS3 = (email) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (!email) {
        return resolve({
          errCode: 1,
          errMessage: "Missing email",
          data: [],
        });
      }

      // tm user theo email
      let user = await db.User.findOne({
        where: { email: email },
        attributes: ["id"],
      });

      if (!user) {
        return resolve({
          errCode: 2,
          errMessage: "Email not exist",
          data: [],
        });
      }

      // ly lch c status = S3
      let data = await db.Booking.findAll({
        where: {
          patientId: user.id,
          statusId: "S3",
        },
        attributes: [
          "id",
          "statusId",
          "date",
          "timeType",
