import db from "../models/index.js";
import axios from "axios";

// ======================
// CACHE  60s
// ======================
const aiCache = new Map();
const CACHE_TTL = 60000;

function getCache(key) {
  const c = aiCache.get(key);
  if (!c) return null;
  if (Date.now() - c.time < CACHE_TTL) return c.data;
  aiCache.delete(key);
  return null;
}

function setCache(key, data) {
  aiCache.set(key, { data, time: Date.now() });
}

// ======================
// THROTTLE  250ms
// ======================
let lastCall = 0;
const wait = (ms) => new Promise((r) => setTimeout(r, ms));

async function throttle() {
  const now = Date.now();
  const diff = now - lastCall;
  if (diff < 250) await wait(250 - diff);
  lastCall = Date.now();
}

// ======================
// TIMEOUT WRAPPER  10s
// ======================
function withTimeout(promise, ms = 10000) {
  return Promise.race([
    promise,
    new Promise((_, reject) =>
      setTimeout(() => reject(new Error("TIMEOUT")), ms)
    ),
  ]);
}

// ==================================================================
//                           MAIN FUNCTION
// ==================================================================

const handleAskAI = async (question) => {
  try {
    const cleanQ = question.trim();

    // 1) CACHE CHECK
    const cached = getCache(cleanQ);
    if (cached) return cached;

    await throttle();

    // 2) Phn loi cu hi lin quan bc s/chuyn khoa
    const keywords = ["bc s", "chuyn khoa", "khm", "th y"];
    const isDoctorQuestion = keywords.some((kw) =>
      cleanQ.toLowerCase().includes(kw)
    );

    let extraContext = "";

    if (isDoctorQuestion) {
      const specialties = await db.Specialty.findAll({
        attributes: ["id", "name"],
        raw: true,
      });

      let match = specialties.find((s) =>
        cleanQ.toLowerCase().includes(s.name.toLowerCase())
      );

      if (match) {
        const doctors = await db.Doctor_Infor.findAll({
          where: { specialtyID: match.id },
          include: [
            {
              model: db.User,
              attributes: [
                "firstName",
                "lastName",
                "phoneNumber",
                "address",
                "gender",
              ],
            },
          ],
          raw: true,
          nest: true,
          limit: 5,
        });

        if (doctors.length > 0) {
          extraContext =
            `Danh sch bc s thuc chuyn khoa "${match.name}":\n` +
            doctors
              .map(
                (d) =>
                  `- Bc s ${d.User.lastName} ${d.User.firstName} | ` +
                  `Gii tnh: ${d.User.gender === "M" ? "Nam" : "N"} | ` +
                  `ST: ${d.User.phoneNumber ?? "Khng c"} | ` +
                  `a ch: ${d.User.address ?? "Khng r"}`
              )
              .join("\n");
        } else {
          extraContext = `Khng c bc s no thuc chuyn khoa "${match.name}".`;
        }
      }
    }

    // 3) Prompt ti u cho model 1B (ngn  hiu qu)
    // const prompt = extraContext
    //   ? `Bn l tr l AI th y.\n${extraContext}\nCu hi: "${cleanQ}"\nTr li ngn gn bng ting Vit.`
    //   : `Bn l tr l AI. Tr li tht ngn gn bng ting Vit:\n"${cleanQ}"`;

    const prompt = extraContext
      ? `Bn l tr l AI h thng qun l phng khm th y.
Nhim v ca bn: tr li cu hi da trn d liu c sn, khng a li khuyn y t hay li t chi trch nhim.
Nu ngi dng hi v bc s, hy tr li bng danh sch bc s ph hp trong d liu sau:

${extraContext}

Cu hi: "${cleanQ}"

Tr li trc tip bng ting Vit, khng t chi, khng cnh bo chung, khng a ra li khuyn iu tr.`
      : `Bn l tr l AI h thng. Tr li ngn gn bng ting Vit:\n"${cleanQ}"`;

    // 4) Gi Ollama
    const response = await withTimeout(
      axios.post("http://localhost:11434/api/generate", {
        model: "llama3.2:1b",
        prompt: prompt,
        stream: false,
      }),
      10000
    );

    console.log("Ollama response:", response.data);

    const text = response.data?.response ?? "AI khng tr li.";

    // 5) Lu cache
    setCache(cleanQ, text);

    return text;
  } catch (err) {
    console.error("AI ERROR:", err.message);

    if (err.message === "TIMEOUT") {
      return "AI phn hi chm, vui lng th li.";
    }

    return "Xin li, h thng AI hin ang gp s c.";
  }
};

export default {
  handleAskAI,
};

