const paymentService = require("../services/paymentService");

let createZaloPayOrder = async (req, res) => {
  try {
    let { bookingId, amount } = req.body;

    // Check input
    if (!bookingId || !amount) {
      return res.status(400).json({
        errCode: 1,
        errMessage: "Missing bookingId or amount!",
      });
    }

    let result = await paymentService.buildZaloPayOrder(bookingId, amount);

    return res.status(200).json(result);
  } catch (e) {
    console.log("Create order error:", e);
    return res.status(500).json({
      errCode: -1,
      errMessage: "Server error!",
    });
  }
};

let zaloPayCallback = async (req, res) => {
  try {
    let callbackData = req.body;

    let result = await paymentService.handleZaloPayCallback(callbackData);

    return res.json(result);
  } catch (e) {
    console.log("Callback controller error:", e);
    return res.json({ return_code: 0, return_message: "error" });
  }
};

module.exports = {
  createZaloPayOrder,
  zaloPayCallback,
};

