const CryptoJS = require("crypto-js");
const moment = require("moment");
const { v4: uuidv4 } = require("uuid");
const config = require("../config/zalopayConfig");

let buildZaloPayOrder = async (bookingId, amount) => {
  try {
    let app_trans_id = `${moment().format("YYMMDD")}_${uuidv4().slice(0, 6)}`;

    let order = {
      app_id: config.appid,
      app_trans_id,
      app_time: Date.now(),
      app_user: "client_user",
      amount,
      item: JSON.stringify([{ bookingId }]),
      description: `Thanh ton lch khm #${bookingId}`,
      embed_data: JSON.stringify({
        redirecturl: "http://localhost:3000/payment-success",
      }),
      bank_code: "",
      // DNG LOCALHOST CHO TEST
      callback_url: "http://localhost:8080/api/zalopay-callback",
    };

    // To MAC
    let macData =
      order.app_id +
      "|" +
      order.app_trans_id +
      "|" +
      order.app_user +
      "|" +
      order.amount +
      "|" +
      order.app_time;

    // order.mac = CryptoJS.HmacSHA256(macData, config.key1).toString();

    return {
      errCode: 0,
      data: order,
    };
  } catch (e) {
    return {
      errCode: -1,
      errMessage: "Build ZaloPay order failed!",
    };
  }
};

let handleZaloPayCallback = async (callbackData) => {
  try {
    const { data, mac } = callbackData;

    // Verify callback MAC
    let macCheck = CryptoJS.HmacSHA256(data, config.callback_key2).toString();
    if (macCheck !== mac) {
      return { return_code: -1, return_message: "Invalid MAC" };
    }

    // Parse d liu
    let json = JSON.parse(data);
    let item = JSON.parse(json.item);
    let bookingId = item[0].bookingId;

    // TODO: Cp nht DB
    // await db.Booking.update({ status: "PAID" }, { where: { id: bookingId } });

    console.log(">>> Payment success for booking:", bookingId);

    return { return_code: 1, return_message: "success" };
  } catch (e) {
    console.log("Callback logic error:", e);
    return { return_code: 0, return_message: "error" };
  }
};

module.exports = {
  buildZaloPayOrder,
  handleZaloPayCallback,
};

